package dmitriy.blanutsa.coursework.persistance.models;import javax.persistence.*;import java.util.List;@Entitypublic class Car extends BaseEntity {    @Column(name = "number", nullable = false)    private String number;    @ManyToOne(fetch = FetchType.LAZY)    @JoinColumn(name = "owner_id", nullable = false)    private Person owner;    @Column(name = "owner_id", nullable = false, insertable = false, updatable = false)    private Integer ownerId;    @ManyToOne(fetch = FetchType.LAZY)    @JoinColumn(name = "model_id", nullable = false)    private Model model;    @Column(name = "model_id", nullable = false, insertable = false, updatable = false)    private Integer modelId;    @OneToMany(fetch = FetchType.LAZY, cascade = CascadeType.ALL, mappedBy = "car")    private List<AttorneyPower> attorneyPowers;    public String getNumber() {        return number;    }    public void setNumber(String number) {        this.number = number;    }    public Person getOwner() {        return owner;    }    public void setOwner(Person owner) {        this.owner = owner;    }    public Integer getOwnerId() {        return ownerId;    }    public void setOwnerId(Integer ownerId) {        this.ownerId = ownerId;    }    public List<AttorneyPower> getAttorneyPowers() {        return attorneyPowers;    }    public void setAttorneyPowers(List<AttorneyPower> attorneyPowers) {        this.attorneyPowers = attorneyPowers;    }    public Model getModel() {        return model;    }    public void setModel(Model model) {        this.model = model;    }    public Integer getModelId() {        return modelId;    }    public void setModelId(Integer modelId) {        this.modelId = modelId;    }}